import React from "react";
import { BsTelephone } from "react-icons/bs";
import { CiMail } from "react-icons/ci";
import {
  AiFillGithub,
  AiFillLinkedin,
  AiFillTwitterCircle,
} from "react-icons/ai";
import image2 from "../img/professional-image2.jpg";

const Footer = () => {
  return (
    <footer className="bg-mainBlue text-white ">
      {/* Container */}
      <div className="flex gap-4 max-w-[1500px] mx-24">
        {/* Contact Info */}
        <div className="flex flex-col gap-4">
          <h1 className="text-2xl"> Contact Me</h1>
          <p>
            {" "}
            Please get in touch if you think our work could be mutually
            beneficial
          </p>

          <p> 1234 Random Road Random Town, Morroco 12345</p>

          <div className="flex gap-4 items-center">
            <BsTelephone className="text-xl" />
            <p> 06-67-15-35-55</p>
          </div>

          <div className="flex gap-4 items-center">
            <CiMail className="text-xl" />
            <p> hamza.eshoul.pro@gmail.com</p>
          </div>

          <div className="flex gap-2 text-3xl text-black">
            <AiFillGithub />
            <AiFillLinkedin />
            <AiFillTwitterCircle />
          </div>
        </div>

        {/* Img */}
        <div className="w-[700px] h-[500px] p-4">
          <img src={image2} className="h-full w-full object-cover " />
        </div>
      </div>
    </footer>
  );
};

export default Footer;
